// Relocate
// - - - - - - - - - - - - - - - - - - - - - - - - -

// * Relocate permet de déplacer des éléments au resize en JavaScript
// * Fonctionnement : relocate(width, elements, destinationElement);
// * Documentation : https://github.com/edenspiekermann/minwidth-relocate
// * Ex. :

// var elements = document.getElementById("elements");
// var sidebar  = document.getElementById("destinationElement");

// relocate(480, elements, destinationElement);

// Variables
// - - - - - - - - - - - - - - - - - - - - - - - - -

// Fichier de configuration
// C'est ici que les variables principales seront stockées

var smallBreackPoints  = 640,
	mediumBreackPoints = 1024;

var smallUp 	= window.matchMedia("(min-width: " + smallBreackPoints + "px)").matches,
	smallOnly   = window.matchMedia("(max-width: " + smallBreackPoints + "px").matches,
	smallMedium = window.matchMedia("(max-width: " + mediumBreackPoints + "px)").matches,
	mediumUp    = window.matchMedia("(min-width: " + smallBreackPoints + "px)").matches,
	mediumOnly  = window.matchMedia("(min-width: " + smallBreackPoints + "px) and (max-width: " + mediumBreackPoints + "px").matches,
	largeUp     = window.matchMedia("(min-width: " + mediumBreackPoints + "px)").matches;

// Function
// - - - - - - - - - - - - - - - - - - - - - - - - -

// Format du numéro
// - - - - - - - - - - - -

// /!\ type text
// Fonction qui change le format de sortie

function number_format_text(id) {
	var value  = id.text();
	var result = value.replace(/(\d)(?=(\d{3})+$)/g, '$1 ');

    id.text(result);
}

// /!\ type input
// Changement du format sur une valeur

function number_format_value(id) {
	var value  = id.val();
	var result = value.replace(/(\d)(?=(\d{3})+$)/g, '$1 ');

    id.val(result);
}

// Navigation
// - - - - - - - - - - - - - - - - - - - - - - - - -

function show_submenu($nav) {

    $nav.on('click', function(event){
        
        var element = Foundation.utils.S(this),
            ul      = element.next('ul'),
            count   = ul.length;

        Foundation.utils.S('.submenu').slideUp('fast');
        
        // On detect si un sous-menu est ouvert
        // Si il l'est et qu'un autre onglet est actif, alors on le ferme

        if (count > 0 && !ul.is(':visible')) {

            ul.slideDown();
            event.preventDefault();

        } else {

            ul.slideUp('fast');

        }
        
        // On detect si le label possède la classe 'active'
        // On detect si le label possède la classe 'active'

        if (Foundation.utils.S(this).hasClass('active')) {
            Foundation.utils.S(this).removeClass('active'); 
        }

        else {
            $nav.find('.active').removeClass('active');
            Foundation.utils.S(this).addClass('active');
        }

    });

}




// Navigation
// - - - - - - - - - - - - - - - - - - - - - - - - -

function navigation() {

    var navigation              = Foundation.utils.S('#l-navigation'),
        navigation_mobile       = Foundation.utils.S('#l-navigation-mobile'),
        navigation_mobile_label = Foundation.utils.S('#l-navigation-mobile > li > label');

    // Mobile
    // - - - - - - - - - - - -

    show_submenu(navigation_mobile_label);



    // Principale
    // - - - - - - - - - - - -

    // Fermeture du sous-menu si on clic à l'exterieur
    // 1. Si le clic n'est pas sur la navigation
    // 2. Alors on cache le sous-menu

    Foundation.utils.S(document.body).click(function(e) {

        if (!Foundation.utils.S(e.target).is(navigation) && !$.contains(navigation[0], e.target)) { // 1

            navigation.find('.submenu').slideUp(); // 2

        }

    });
    
};

// Colorbox
// - - - - - - - - - - - - - - - - - - - - - - - - -

function colorbox_init() {

	// Image
	$(".cb-image").colorbox({
		rel: 'group1'
	});

	// Iframe
	$('.cb-iframe').colorbox({
		width: '80%',
		height: '80%',
		iframe: true,
		fixed: true,
		title: false,
	});

};

// HAMMER
// - - - - - - - - - - - - - - - - - - - - - - - - -

function hammer_swip() {

	$("#page").hammer().on("swipeleft", function(ev) { 

		$(this).addClass('move-right');

	}).on("swiperight", function(ev) {

		$(this).removeClass('move-right');

	});

};

// Variables
// - - - - - - - - - - - - - - - - - - - - - - - - -

function grid() {

    var buttonVerticalGrid = Foundation.utils.S('#show-vertical-grid'),
        buttonHorizontalGrid = Foundation.utils.S('#show-horizontal-grid'),
        buttonHorizontalGrid8 = Foundation.utils.S('#show-horizontal-grid-8'),
        buttonHorizontalGrid16 = Foundation.utils.S('#show-horizontal-grid-16'),
        buttonHorizontalGrid32 = Foundation.utils.S('#show-horizontal-grid-32'),
        gridVertical = Foundation.utils.S('#grid-vertical'),
        gridHorizontal8 = Foundation.utils.S('#grid-horizontal-8'),
        gridHorizontal16 = Foundation.utils.S('#grid-horizontal-16'),
        gridHorizontal32 = Foundation.utils.S('#grid-horizontal-32'),
        content = Foundation.utils.S('#l-content');

    buttonVerticalGrid.click(function() {

        gridVertical.toggleClass('hide');

    });

    buttonHorizontalGrid8.click(function() {

        gridHorizontal8.toggleClass('hide');

    });

    buttonHorizontalGrid16.click(function() {

        gridHorizontal16.toggleClass('hide');

    });

    buttonHorizontalGrid32.click(function() {

        gridHorizontal32.toggleClass('hide');

    });

}
